import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "./Routes/Home";
import Tv from "./Routes/Tv";
import Search from "./Routes/Search";
import Header from "./components/Header";

function App() {
  return (
    <Router>
      <Header>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/tv">
            <Tv />
          </Route>
          <Route path="/search">
            <Search />
          </Route>
        </Switch>
      </Header>
    </Router>
  );
}

export default App;
